import React from 'react'

const UserListItem = ({data}) => {
  return (
    <div style={{display:'flex'}}>
      <div>{data.id}</div>
      <div>{data.name}</div>
      <div>{data.email}</div>
      <button>상세</button>
    </div>
  )
}

export default UserListItem
